import React from "react";
import { useSelector } from "react-redux";
import Loading from "../Loading/Loading";
import "./index.scss";
const Notify = () => {
  const { notify, auth } = useSelector((state) => state);
  return (
    <>
      <div>{notify.loading && <Loading />}</div>
    </>
  );
};

export default Notify;
